import React, { useState } from 'react';
import styled from 'styled-components';

const Dropdown = ({ options, placeholder, showCountButtons }) => {
    const [isOpen, setIsOpen] = useState(false); // 드롭다운 열기 상태
    const [selectedOption, setSelectedOption] = useState(''); // 선택된 옵션
    const [searchTerm, setSearchTerm] = useState(''); // 검색어 상태
    const [isFocused, setIsFocused] = useState(false); // 포커스 상태 추가
    const [peopleCount, setPeopleCount] = useState(0); // 인원수 상태 추가

    // 옵션을 검색어로 필터링
    const filteredOptions = options.filter(option =>
        option.label.toLowerCase().includes(searchTerm.toLowerCase())
    );

    // 옵션 클릭 시 선택된 옵션 상태 업데이트
    const handleOptionClick = (option) => {
        setSelectedOption(option.label);
        setIsOpen(false); // 드롭다운 닫기
        setSearchTerm(''); // 검색어 초기화
    };

    // 플레이스홀더 클릭 시 드롭다운 열기
    const handlePlaceholderClick = () => {
        setIsOpen(true);
        setSearchTerm(''); // 플레이스홀더 클릭 시 검색어 초기화
    };

    // 입력값 변경 시 검색어 업데이트
    const handleInputChange = (e) => {
        setSearchTerm(e.target.value);
    };

    // 인원 수 증가
    const incrementCount = () => {
        setPeopleCount(prevCount => prevCount + 1);
    };

    // 인원 수 감소
    const decrementCount = () => {
        setPeopleCount(prevCount => (prevCount > 0 ? prevCount - 1 : 0));
    };

    return (
        <DropdownWrapper>
            <DropdownHeader 
                onClick={handlePlaceholderClick} 
                isFocused={isFocused} // 포커스 상태 전달
                onFocus={() => setIsFocused(true)} // 포커스 상태 설정
                onBlur={() => setIsFocused(false)} // 포커스 해제 시 상태 초기화
            >
                <SearchInput
                    type="text"
                    placeholder={selectedOption || placeholder} // 선택된 옵션이 없으면 플레이스홀더 사용
                    value={searchTerm}
                    onChange={handleInputChange} // 입력값 변경 시 함수 호출
                    onFocus={() => setIsOpen(true)} // 검색 입력란 클릭 시 드롭다운 열기
                    isSelected={!!selectedOption} // 선택된 옵션 여부 전달
                />
                {showCountButtons && ( // 인원 수 버튼이 필요할 때만 렌더링
                    <CountContainer>
                        <Button onClick={decrementCount}>-</Button>
                        <Count>{peopleCount}</Count>
                        <Button onClick={incrementCount}>+</Button>
                    </CountContainer>
                )}
            </DropdownHeader>
            {isOpen && ( // 드롭다운이 열릴 때만 옵션 리스트 표시
                <DropdownList>
                    {filteredOptions.length > 0 ? (
                        filteredOptions.map(option => (
                            <DropdownItem 
                                key={option.value} 
                                onClick={() => handleOptionClick(option)} // 옵션 클릭 시 함수 호출
                            >
                                {option.label}
                            </DropdownItem>
                        ))
                    ) : (
                        <NoOptions>옵션이 없습니다.</NoOptions> // 필터링 후 옵션이 없을 때 표시
                    )}
                </DropdownList>
            )}
        </DropdownWrapper>
    );
};

// 스타일 컴포넌트 정의
const DropdownWrapper = styled.div`
    position: relative;
    width: 300px; /* 드롭다운 너비 설정 */
`;

const DropdownHeader = styled.div`
    border: 2px solid ${({ isFocused }) => (isFocused ? '#007BFF' : '#A0DAFB')}; /* 포커스 상태에 따라 테두리 색상 변경 */
    border-radius: 15px;
    padding: 8px;   
    cursor: pointer;
    background-color: #fff;
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-left: 20px;
    font-size: 14px;
    color: black;
`;

const DropdownList = styled.div`
    position: absolute;
    border: 2px solid #A0DAFB;
    border-radius: 15px;
    background: white;
    width: 100%;
    max-height: 200px;
    overflow-y: auto;
    z-index: 1000;
`;

const SearchInput = styled.input`
    padding: 4px;
    border: none;
    width: 100%;
    box-sizing: border-box;
    outline: none; /* 포커스 시 외곽선 제거 */

    &::placeholder {
        color: ${({ isSelected }) => (isSelected ? 'black' : 'grey')}; /* 플레이스홀더 색상 변경 */
    }
`;

const CountContainer = styled.div`
    display: flex;
    align-items: center;
`;

const Button = styled.button`
    border: 1px solid #A0DAFB;
    background: white;
    padding: 4px 8px;
    cursor: pointer;
`;

const Count = styled.span`
    margin: 0 10px;
`;

const DropdownItem = styled.div`
    padding: 10px;
    cursor: pointer;

    &:hover {
        background-color: rgba(160, 218, 251, 0.5);
    }
`;

const NoOptions = styled.div`
    padding: 10px;
    color: #aaa;
`;

export default Dropdown;
